import React from "react";
import "../Footer/Footer.css"

function Footer() {
  return (
    <footer>
      <div className="footerInfo">
        <h1>
          Contact Info:
                </h1>
        <p>
          <strong>
            GitHub:
                  </strong>
          <a href="https://github.com/novaaaax" target="_blank" rel="noopener noreferrer" className="github"> <i class="fab fa-github-square"></i></a> </p>
        <p><strong>LinkedIn:</strong><a href="https://www.linkedin.com/in/edwin-genova-409696117/" target="_blank" rel="noopener noreferrer"> <i class="fab fa-linkedin"></i></a></p>
        <p><strong>Email:</strong><a href="mailto:edwingenova@gmail.com" target="_blank" rel="noopener noreferrer"> edwingenova@gmail.com</a></p>
      </div>
    </footer>
  );
}
export default Footer;
